import React from "react";
import "../../CSS/SchoolPanel.css"

class SchoolPanel extends React.Component {

    constructor(props) {
        super(props);
        const elems = props;
    }

    tabHeader() {
        return <tr><th>Name</th><th>Adress</th><th>Phone number</th></tr>;
    }

    tabData(tab) {
        let output = "";
        for(let elem in tab) {
            output.push();
        }
    }

    render() {
        return <div>
            <table>
               {this.tabHeader()}
               {this.tabData(elems)}
            </table>
        </div>
    }
}

export default SchoolPanel;
